         <div className="col-2"></div>
         <div className="col-2">
            <button  type="button" className="btn btn-outline-dark mr-3">ADD</button>
            <button type="button" className="btn btn-outline-dark">MASS DELETE</button>
         </div>
         {/* <div class="col-md-auto"> <button type="button" class="btn btn-outline-dark">ADD</button></div>
         <div class="col-md-auto"> <button type="button" class="btn btn-outline-dark">MASS DELETE</button></div> */}
         <hr/>
        </div>
    )
}


export default ListButtons;
